import { getPrinter } from "../../../data/data";
import { useParams } from "react-router-dom";

export function PrinterDetails(){

    let param = useParams();
    let printer=getPrinter(param.printerDetails);


    return (
        <div>
        <h1>{printer.name}</h1>
        <div className="myPrinter">

            <h3>Nozzles mounted:<p>{printer.nozzlesMounted}</p></h3>
            <h3>Soluble:<p>{printer.soluble}</p></h3>
            <h3>Food safety:<p>{printer.foodSafety}</p></h3>            
        </div>
        </div>
    )   
}

